import React from "react";

function Nav() {
  return (
    <nav className="navbar navbar-expand navbar-light bg-info">
    <div className="container-fluid">
    <a to="/" className="navbar-brand text-lg font-effect-shadow-multiple">Kelly Hunter</a>
    <div className="navbar-nav justify-space-between-lg justify-center align-center">
      <a to="/units" className="nav-a">About Me</a>
      <a to="/waitlist" className="nav-a"> Portfolio</a>
      <a to="/faq" className="nav-a">Contact</a>
      <a to="/contact" className="nav-a">Resume</a>
    </div>
    </div>

    </nav>
  );
}

export default Nav;
